Content:
@Mario Ishikawa, I have been enjoying listening to "So Good They Can't Ignore You". I am definitely going to need to listen to this one again.

The career capital concept is an interesting one and makes a lot of sense to me. The story about the farmer who worked for 10 years before he started his own business was very interesting. Because of his experience he was able to use that "career capital" to secure a loan to start his business.

Thanks again for recommending this to me.

\> **unified namespade**
